      window._sharedData = {"settings":{"API_URL":"https://api.chrono.gg","ASSET_URL":"https://cdn.chrono.gg","FCM_PUBLIC_KEY":"BAsGXb4l7rAhl69B1cC6OX-12RvIoZyv68HfepS_IvhTdolOMh4V8Y_SMEuqnNbOIc0T-CUDCH-VTJfSAgQAv0g","FCM_SENDER_ID":"21720243229","FIREBASE_API_KEY":"AIzaSyCvXrYCGFkzRBWw3SOQcsad7JPPCpjylkE","FIREBASE_AUTH_DOMAIN":"chrono-prod.firebaseapp.com","FIREBASE_DATABASE_URL":"https://chrono-prod.firebaseio.com","FIREBASE_PROJECT_ID":"chrono-prod"},"features":[{"_id":"5cc319fa303b39000fd3a03a","packageDetails":{"details":[]},"featuredItems":{"featuredItem":0,"items":[{"details":{"tags":[],"developer":"","publisher":"","released":"","rating":"NR"},"features":{"controllerSupport":false,"steamWorkshop":false,"playTime":"N/A","players":[]},"key":{"label":"","provider":"chrono","regionalLockout":[],"type":"single"},"bonusCoins":65,"briefDescription":"","detailedDescription":"<p>FRAMED Collection is a new compilation of the critically-acclaimed, multi-award winning noir puzzle games FRAMED and FRAMED 2.</p>\n<p>Change the order, change the outcome.</p>\n<p>Rearrange the panels of an animated comic book to craft the story of a noir-styled spy adventure. Presented in an extensive series of visual puzzles, requiring logic and imagination, each panel move changes the current narrative, leading to all kinds of comedic blunders, untimely deaths—and when solved correctly—stylish heists, fast getaways and nail-biting escapades.</p>\n<p>With multi-award winning, genre-bending puzzle design, stylish hand crafted art and animation, a satisfying difficulty curve, and an original live jazz soundtrack--fusing modern themes and funky beats--the FRAMED Collection is a unique experience no other puzzle game can match.</p>\n<p><strong>The Complete FRAMED experience</strong><br />\nFRAMED Collection is a new compilation of the award-winning, noir puzzle games FRAMED and FRAMED 2. Escape effortlessly into the stylish, pulp-noir spy world of FRAMED, before delving deeper with the more challenging prequel FRAMED 2.</p>\n<p><strong>Simple, but uniquely clever puzzle design</strong><br />\nSelect animated comic panels and move them around using your logic skills and your imagination to craft the best outcome. Getting the story ‘wrong’ is as much part of the experience as getting it ‘right’, with every rearrangement telling a different, satisfying--and sometimes very comedic--story.</p>\n<p><strong>Hand-crafted noir art and animation</strong><br />\nFrom the first frame to the last, FRAMED collection oozes with stylish, noir, award-winning art and animation. Unique, hand-drawn silhouetted characters, incredibly fluid animations, and beautiful, mysterious settings all bring the FRAMED world to life with a wink of mischievous personality.</p>\n<p><strong>Multi-award winning, genre-bending design</strong><br />\nFRAMED Collection features a fusion of unique game mechanics and clever narrative puzzles that bend genres and constantly deliver a satisfying experience with every panel arrangement. A winner of multiple game awards, and a finalist of IGF 2015’s ‘Excellence in Design’ Award, Hideo Kojima named FRAMED his Game of the Year in 2014--“without any doubt”.</p>\n<p><strong>An all-original live jazz soundtrack</strong><br />\nFeaturing live jazz performances fused with modern themes and funky beats, the soundtracks to FRAMED and FRAMED 2 are as mesmerising as they are evocative, setting the mood and upping the mystery-laden tension.</p>\n","maxQuantity":4,"name":"FRAMED Collection","rating":"T","releaseDate":"5/17/2018","showClaimed":false,"url":"https://store.steampowered.com/app/322450/FRAMED_Collection/?curator_clanid=33025617","_id":"5cc319fa303b39000fd3a03b","keyProviders":[],"notes":[],"reviews":[],"platforms":[{"_id":"5cc319fa303b39000fd3a03e","type":"windows","minimum":"<strong>Minimum:</strong><br><ul class=\"bb_ul\"><li><strong>OS:</strong> Windows 7+<br></li><li><strong>Processor:</strong> 2GHz, Dual Core<br></li><li><strong>Memory:</strong> 2 GB RAM<br></li><li><strong>Graphics:</strong> 512MB VRAM<br></li><li><strong>Storage:</strong> 2 GB available space</li></ul>"},{"_id":"5cc319fa303b39000fd3a03d","type":"macos","minimum":"<strong>Minimum:</strong><br><ul class=\"bb_ul\"><li><strong>OS:</strong> MacOS Sierra+<br></li><li><strong>Processor:</strong> 2GHz, Dual Core<br></li><li><strong>Memory:</strong> 2 GB RAM<br></li><li><strong>Graphics:</strong> 512MB VRAM<br></li><li><strong>Storage:</strong> 2 GB available space</li></ul>","recommended":"<strong>Recommended:</strong><br><ul class=\"bb_ul\"><li><strong>OS:</strong> OSX 10.10+<br></li><li><strong>Memory:</strong> 4 GB RAM<br></li><li><strong>Graphics:</strong> 1GB<br></li><li><strong>Storage:</strong> 2 GB available space</li></ul>"},{"_id":"5cc319fa303b39000fd3a03c","type":"linux","minimum":"<strong>Minimum:</strong><br><ul class=\"bb_ul\"><li><strong>OS:</strong> Ubuntu 16.04.3 LTS (Xenial Xerus)+<br></li><li><strong>Processor:</strong> 1.8+ GHz or better<br></li><li><strong>Memory:</strong> 2 GB RAM<br></li><li><strong>Graphics:</strong> 512MB<br></li><li><strong>Storage:</strong> 2 GB available space</li></ul>","recommended":"<strong>Recommended:</strong><br><ul class=\"bb_ul\"><li><strong>Processor:</strong> 2.2+ GHz or better<br></li><li><strong>Memory:</strong> 4 GB RAM<br></li><li><strong>Graphics:</strong> 1GB<br></li><li><strong>Storage:</strong> 2 GB available space</li></ul>"}],"screenshots":[],"normalPrice":9.99,"featuredPrice":6.49,"buttonText":"Buy Game"}]},"createdAt":"1970-01-01T00:00:00.000Z","modifiedAt":"1970-01-01T00:00:00.000Z","communityUrl":"https://community.chrono.gg/t/framed-collection-5-1-19-6-49/16725","copy":"<h2>COMICS N’ COFFEE</h2>\n<p>Listen, I was just doing what I always do, reading a comic with my coffee in the morning to get my right and put me in touch with my sense of childlike wonder, see? Don’t judge me for that, ya loser, okay? And as I’m getting deeper into the story I see it’s about spies, except I’m thinkin’ to myself as I read it, I says “Wait just a minute here, all these spies keep dyin!” It was like they wasn’t even good at their jobs or somethin’, it was crazy.</p>\n<p>But then I really started looking at the panels and I thought to myself…”you know, this spy would be way better at not getting spotted if this panel here came before this panel here”. And I know what you’re thinking, that sounds absolutely crazy, but if you don’t cultivate your sense of childlike wonder, your brain won’t even have a chance of working like that. I sipped my coffee, made a wish, and tried dragging the panel over. It worked! Did I mention I read my comics on a computer?</p>\n<p>Well, sure enough, it turns out the person I share my computer with, which is another way I sometimes refer to my mom, bought a copy of the Framed Collection on sale today from Chrono.gg, and dragging comic panels around is exactly what it’s all about! To be honest it sounded sacreligious at first, but once I heard Hideo Kojima named the first game as his game of the year a few years back, I kept going with it and I’m glad I did. Now I’m gonna go top off my coffee, so go buy the game, okay? Cool.</p>","description":"","disabled":false,"emailTemplate":"purchase","hidden":false,"featuredPick":false,"maxRevShare":0.18,"multiplayerBar":false,"name":"FRAMED Collection","ogDescription":"FRAMED Collection is only $6.49 right now!","twitterShareText":"FRAMED Collection is only $6.49 right now on www.chrono.gg! #gamedeals via @chronodeals @LoveShackers @FellowTravellr","startsAt":"2019-05-01T16:00:00.000Z","endsAt":"2019-05-02T16:00:00.000Z","developer":{"_id":"5cc3199b303b39000fd3a038","store":{"allowPartnerAttribution":false,"disabled":true,"features":[],"featuredPicks":[],"subdomains":[]},"active":true,"approved":false,"users":[],"name":"Loveshack Entertainment","urls":[{"active":true,"live":false,"_id":"5cc3199b303b39000fd3a039","url":"https://loveshackentertainment.com/","type":"homepage"}],"type":"developer"